	id_10015 = {10015, "娜美", "奈美", 1, "2", "草帽一伙的航海士。精通气象学和航海术，用身体感知天气，是个能精确画出航海图的天才航海士。喜欢的东西是钱和橘子，梦想是要画出全世界的地图。", "fight_elite_namei.png", "head_elite_namei.png", "body_elite_namei.png", "body_elite_namei.png", "nuqi_namei.png", "15", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 1280, nil, 1290, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 5, nil, nil, 5, nil, 10015, 2, 1000, 5000, 10000, 500, 500, "51500", "2|1|901,2|3|3301,2|5|9302,2|6|103,2|7|30900,2|8|405,2|9|6004,2|10|107", "310015,330015,430015,29,180,241", nil, 10, 13, },
	id_10016 = {10016, "乔巴", "乔巴", 1, "1", "草帽一伙的船医，人人之果能力者，可用蓝波球进行八段身体变形，喜欢吃棉花糖。梦想是成为“万能药”。", "fight_elite_qiaoba.png", "head_elite_qiaoba.png", "body_elite_qiaoba.png", "body_elite_qiaoba.png", "nuqi_qiaoba.png", "15", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 1300, nil, 1310, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|205008", 5, nil, nil, 5, nil, 10016, 3, 1000, 5000, 10000, 500, 500, "51600,80800", "2|1|3100,2|3|3601,2|5|9302,2|6|103,2|7|9502,2|8|405,2|9|32600,2|10|107", "210016,340016,1010016,30,191,279", nil, 10, 13, },
	id_10017 = {10017, "战桃丸", "战桃丸", 1, "1", "海军本部科学部队队长，扛着一把大斧头，自称世界第一守口如瓶的男人，但是每次都会不由自主的把情报泄漏出去。", "fight_elite_zhantaowan.png", "head_elite_zhantaowan.png", "body_elite_zhantaowan.png", "body_elite_zhantaowan.png", "nuqi_zhantaowan.png", "16", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 1320, nil, 1330, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 6, nil, nil, 6, nil, 10017, 2, 1000, 5000, 10000, 500, 500, "51700", "2|1|401,2|3|3401,2|5|9302,2|6|103,2|7|5703,2|8|405,2|9|5905,2|10|107,2|11|33200", "140017,190017,370017,20,291,218,359", nil, 10, 16, },
	id_10018 = {10018, "斯摩格", "烟鬼", 1, "1", "烟雾之果能力者，海军准将。银色短发，全身可以随意变成烟雾，烟雾可实体化、困住敌人。使用武器为海楼石十手。", "fight_elite_simoge.png", "head_elite_simoge.png", "body_elite_simoge.png", "body_elite_simoge.png", "nuqi_simoge.png", "15", nil, nil, nil, nil, 2, 8, 6, nil, nil, nil, nil, nil, nil, nil, 1340, nil, 1350, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|205009", 5, nil, nil, 5, nil, 10018, 1, 1000, 5000, 10000, 500, 500, "51800,80900", "2|1|101,2|3|1101,2|5|9302,2|6|103,2|7|3702,2|8|405,2|9|20900,2|10|107", "310018,340018,750018,31,252,228", nil, 10, 13, },
