	id_10028 = {10028, "毒Q", "毒Q", 1, "1", "黑胡子海盗团船医，有“死神”之称。身为船医的他，却总是一副病入膏肓，奄奄一息的样子。", "fight_elite_duq.png", "head_elite_duq.png", "body_elite_duq.png", "body_elite_duq.png", nil, "16", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 1540, nil, 1550, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 6, nil, nil, 6, nil, 10028, 3, 1000, 5000, 10000, 500, 500, "52800", "2|1|1001,2|3|3601,2|5|9302,2|6|103,2|7|3102,2|8|405,2|9|3404,2|10|107", "40028,700028,820028,850028,91", nil, 10, 16, },
