	id_10031 = {10031, "路飞", "路飞", 1, "1", "草帽一伙船长。因为四皇“红发”杰克斯委托保管的草帽，被称为“草帽小子路飞”。橡胶果实的能力者，梦想是完成对杰克斯的承诺，找到传说中的ONE PIECE，成为海盗王。", "fight_elite_lufei.png", "head_elite_lufei.png", "body_elite_lufei.png", "body_elite_lufei.png", "nuqi_lufei.png", "15", nil, nil, nil, nil, 2, 8, 6, nil, nil, nil, nil, nil, nil, nil, 1600, nil, 1610, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|205019", 5, nil, nil, 5, nil, 10031, 4, 1000, 5000, 10000, 500, 500, "53100,81900", "2|1|31000,2|3|1401,2|5|9302,2|6|103,2|7|1202,2|8|405,2|9|3504,2|10|107", "310018,310025,410031,36,275,230", nil, 10, 13, },
