	id_10035 = {10035, "艾斯", "艾斯", 1, "1", "燃烧之果能力者，能将身体变成火焰体质并用以攻击。路飞的义兄，白胡子海盗团第二番队队长。背部刺有“白胡子海盗团”的图样，这象征着他一生最重视的荣誉。", "fight_elite_aisi.png", "head_elite_aisi.png", "body_elite_aisi.png", "body_elite_aisi.png", "nuqi_aisi.png", "16", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 1680, nil, 1690, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|205021", 6, nil, nil, 6, nil, 10035, 4, 1000, 5000, 10000, 500, 500, "53500,82100", "2|1|901,2|3|3501,2|5|9302,2|6|104,2|7|3603,2|8|405,2|9|31800,2|10|108,2|11|33400", "230035,250035,310035,17,194,254,356", nil, 10, 16, },
