	id_10048 = {10048, "蒂波", "卡特琳·蝶美", 1, "2", "关押在因佩尔监狱最下层的史上最凶恶女囚。特征是浓妆艳抹、奇装异服和高耸的鼻子，是个如同魔女一般的海盗。被黑胡子一行救出，加入黑胡子一行。", "fight_elite_diemei.png", "head_elite_diemei.png", "body_elite_diemei.png", "body_elite_diemei.png", nil, "15", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 1940, nil, 1950, "999|0,999|0,999|0", 1000, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 5, nil, nil, 5, nil, 10048, 1, 1000, 5000, 10000, 500, 500, "54800", "2|1|1001,2|3|1201,2|5|9302,2|6|103,2|7|9002,2|8|405,2|9|3304,2|10|107", "570048,720048,810048,91", nil, 10, 13, },
