	id_10050 = {10050, "鼯鼠中将", "鼯鼠", 1, "1", "海军本部中将，实力非凡，擅长剑术，是参与司法岛“屠魔令”的五位中将之一，在顶上战争中有精彩表现，后升任G1支部的负责人。", "fight_elite_youshuzhongjiang.png", "head_elite_youshuzhongjiang.png", "body_elite_youshuzhongjiang.png", "body_elite_youshuzhongjiang.png", nil, "14", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 1980, nil, 1990, "999|0,999|0,999|0", 1000, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10050, 2, 1000, 5000, 10000, 500, 500, nil, "2|1|901,2|3|4901,2|5|9302,2|6|403,2|7|1102,2|8|105,2|9|9404", "250050,770050,870050,117,129,306", nil, 10, 10, },
