	id_10052 = {10052, "路奇", "罗布·鲁兹", 1, "1", "猫猫之果（豹形态）能力者，原世界政府杀手谍报组织CP9实质上的队长，以黑暗的正义为本职，被称为CP9历代最强最冷酷的杀戮兵器。", "fight_elite_luqi.png", "head_elite_luqi.png", "body_elite_luqi.png", "body_elite_luqi.png", "nuqi_luqi.png", "16", nil, nil, nil, nil, 2, 8, 6, nil, nil, nil, nil, nil, nil, nil, 2020, nil, 2030, "999|0,999|0,999|0", 1100, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|205029", 6, nil, nil, 6, nil, 10052, 4, 1000, 5000, 10000, 500, 500, "55200,82900", "2|1|101,2|3|9401,2|5|9302,2|6|103,2|7|3703,2|8|405,2|9|1105,2|10|107,2|11|5807", "270052,420052,890052,27,271,232,366", nil, 10, 16, },
