	id_10054 = {10054, "萨奇", "沙奇", 1, "1", "白胡子海盗团第四番队队长，原黑暗之果的拥有者。原与提奇是好朋友，却因为持有提奇梦寐以求的黑暗之果而遭偷袭杀害。", "fight_elite_shaqi.png", "head_elite_shaqi.png", "body_elite_shaqi.png", "body_elite_shaqi.png", nil, "15", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 2060, nil, 2070, "999|0,999|0,999|0", 1100, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 5, nil, nil, 5, nil, 10054, 2, 1000, 5000, 10000, 500, 500, "55400", "2|1|901,2|3|3601,2|5|9302,2|6|103,2|7|3102,2|8|405,2|9|1105,2|10|107", "350054,550054,810054,97", nil, 10, 13, },
