	id_10056 = {10056, "布拉曼克", "布拉门科", 1, "1", "白胡子海盗团第六番队队长，疑似恶魔果实能力者。看起来可爱又滑稽，总是手持一个大锤。战斗时可以从下巴的口袋处拿出锤子。", "fight_elite_blmk.png", "head_elite_blmk.png", "body_elite_blmk.png", "body_elite_blmk.png", nil, "15", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 2100, nil, 2110, "999|0,999|0,999|0", 1100, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 5, nil, nil, 5, nil, 10056, 1, 1000, 5000, 10000, 500, 500, "55600", "2|1|201,2|3|5301,2|5|9302,2|6|103,2|7|1102,2|8|405,2|9|10204,2|10|107", "790056,800056,830056,93", nil, 10, 13, },
	id_10057 = {10057, "拉非特", "拉斐特", 1, "1", "黑胡子海盗团航海士，戏剧人物打扮，经常玩弄手中的拐棍。原为西海的保安官，因为过度使用暴力而在那里声名狼藉，后被驱逐出境。", "fight_elite_lft.png", "head_elite_lft.png", "body_elite_lft.png", "body_elite_lft.png", nil, "16", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 2120, nil, 2130, "999|0,999|0,999|0", 1100, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 6, nil, nil, 6, nil, 10057, 2, 1000, 5000, 10000, 500, 500, "55700", "2|1|201,2|3|5901,2|5|9302,2|6|103,2|7|3202,2|8|405,2|9|3304,2|10|107", "150057,570048,830057,98", nil, 10, 16, },
	id_10058 = {10058, "范.奥卡", "旺·奥加", 1, "1", "黑胡子海盗团狙击手，使用武器为长枪“千陆”，能无声无响地击中数公里外的目标，他的单片式望远镜可以看清远方的目标，口头禅是“这就是命运啊！”。", "fight_elite_aojia.png", "head_elite_aojia.png", "body_elite_aojia.png", "body_elite_aojia.png", nil, "16", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 2140, nil, 2150, "999|0,999|0,999|0", 1100, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 6, nil, nil, 6, nil, 10058, 2, 1000, 5000, 10000, 500, 500, "55800", "2|1|301,2|3|1101,2|5|9302,2|6|103,2|7|3502,2|8|405,2|9|10204,2|10|107", "140058,280058,580047,98", nil, 10, 16, },
