	id_10076 = {10076, "Mr.2", "本萨姆", 1, "1", "模仿之果能力者，擅长人妖拳法。为人重友情，讲义气，经常以自己是一个人妖为荣。通常身穿一件天鹅服。最崇拜的偶像是“奇迹之人”——人妖王伊娃科夫。", "fight_elite_mr2.png", "head_elite_mr2.png", "body_elite_mr2.png", "body_elite_mr2.png", "nuqi_mr2.png", "15", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 2500, nil, 2510, "999|0,999|0,999|0", 1000, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|205038", 5, nil, nil, 5, nil, 10076, 3, 1000, 5000, 10000, 500, 500, "57600,83800", "2|1|401,2|3|5601,2|5|9302,2|6|103,2|7|3602,2|8|405,2|9|5804,2|10|107", "310076,760033,760041,46,158,267", nil, 10, 13, },
