	id_10105 = {10105, "Miss.黄金周", "Ms.黄金周", 1, "2", "原为巴洛克集团的高级干部之一，MR.3的搭档，可以调色画板的颜料调配颜色以暗示他人控制他人感情。", "fight_elite_huangjinzhou.png", "head_elite_huangjinzhou.png", "body_elite_huangjinzhou.png", "body_elite_huangjinzhou.png", nil, "14", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 3080, nil, 3090, "999|0,999|0,999|0", 600, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10105, 2, 1000, 5000, 10000, 500, 500, nil, "2|1|200,2|3|5701,2|5|9302,2|6|403,2|7|1102,2|8|105", "1040105,1280105,110,349,210", nil, 10, 10, },
