	id_10109 = {10109, "Miss.情人节", "Ms.情人节", 1, "2", "轻重之果能力者，巴洛克集团MR.5的搭档。看起来是一个打扮时髦的美女，但是性格却很轻浮。根据果实能力，可以任意改变自身体重。", "fight_elite_qingren.png", "head_elite_qingren.png", "body_elite_qingren.png", "body_elite_qingren.png", nil, "14", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 3160, nil, 3170, "999|0,999|0,999|0", 900, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|204006", 4, nil, nil, 4, nil, 10109, 2, 1000, 5000, 10000, 500, 500, "85600", "2|1|300,2|3|1201,2|5|9302,2|6|403,2|7|3602,2|8|105", "1090106,1090108,110,172,350", nil, 10, 10, },
	id_10110 = {10110, "多尔顿", "多尔顿", 1, "1", "牛牛之果能力者，会三段变身，喜欢栗子饭，性格善良。击败残暴的铁桶岛国王之后被推举成为樱花国国王。", "fight_elite_drd.png", "head_elite_drd.png", "body_elite_drd.png", "body_elite_drd.png", nil, "14", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 3180, nil, 3190, "999|0,999|0,999|0", 900, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|204007", 4, nil, nil, 4, nil, 10110, 3, 1000, 5000, 10000, 500, 500, "85700", "2|1|100,2|3|3601,2|5|9302,2|6|403,2|7|7802,2|8|105", "1110110,1270110,112,327,203", nil, 10, 10, },
	id_10111 = {10111, "伊卡莱姆", "伊格拉姆", 1, "1", "阿拉巴斯坦王国护卫队长，为了保护薇薇公主和探查巴洛克集团的秘密，和薇薇公主一起潜入了巴洛克集团成为卧底。", "fight_elite_yika.png", "head_elite_yika.png", "body_elite_yika.png", "body_elite_yika.png", nil, "14", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 3200, nil, 3210, "999|0,999|0,999|0", 900, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10111, 3, 1000, 5000, 10000, 500, 500, nil, "2|1|300,2|3|9501,2|5|9302,2|6|403,2|7|4702,2|8|105", "620111,1110110,111,320,211", nil, 10, 10, },
	id_10112 = {10112, "哲夫", "卓夫", 1, "1", "海上餐厅的老板兼主厨，曾经是赫赫有名的大海盗，山智的师父，也是曾经进入伟大航线一年仍然全身而退的传奇人物。", "fight_elite_zhefu.png", "head_elite_zhefu.png", "body_elite_zhefu.png", "body_elite_zhefu.png", nil, "14", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 3220, nil, 3230, "999|0,999|0,999|0", 1100, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10112, 2, 1000, 5000, 10000, 500, 500, nil, "2|1|300,2|3|3601,2|5|9302,2|6|403,2|7|5702,2|8|105,2|9|5104", "330112,1120097,1310112,89,124,341", nil, 10, 10, },
	id_10113 = {10113, "阿龙", "阿龙", 1, "1", "锯齿鲨鱼人，阿龙一伙船长，认为鱼人是高等种族，人类是废物。企图建立自己的恶龙帝国称霸东海。", "fight_elite_along.png", "head_elite_along.png", "body_elite_along.png", "body_elite_along.png", nil, "14", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 3240, nil, 3250, "999|0,999|0,999|0", 1100, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10113, 3, 1000, 5000, 10000, 500, 500, nil, "2|1|300,2|3|5801,2|5|9302,2|6|403,2|7|3602,2|8|105,2|9|9504", "260113,1180113,1220113,102,133,333", nil, 10, 10, },
	id_10114 = {10114, "寇沙", "空扎", 1, "1", "原叛乱军首领，现为阿拉巴斯坦环境保卫大臣。很有领导者的气质，有首领风范，组织能力和号召能力都很强，在民众中很有威望。", "fight_elite_kousha.png", "head_elite_kousha.png", "body_elite_kousha.png", "body_elite_kousha.png", nil, "14", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 3260, nil, 3270, "999|0,999|0,999|0", 700, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10114, 3, 1000, 5000, 10000, 500, 500, nil, "2|1|200,2|3|3201,2|5|9302,2|6|403,2|7|3602,2|8|105", "430114,1140100,113,308,164", nil, 10, 10, },
