	id_10117 = {10117, "巴里", "巴利", 1, "1", "七水之城Galley-La工头， 索具、桅杆工人，后来升格为卡雷拉造船公司副社长，喜欢抽雪茄，因为好赌博而常被债主追着跑。", "fight_elite_bali.png", "head_elite_bali.png", "body_elite_bali.png", "body_elite_bali.png", nil, "14", nil, nil, nil, nil, 2, 8, 6, nil, nil, nil, nil, nil, nil, nil, 3320, nil, 3330, "999|0,999|0,999|0", 800, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10117, 3, 1000, 5000, 10000, 500, 500, nil, "2|1|200,2|3|1201,2|5|9302,2|6|403,2|7|3302,2|8|105", "1170116,1200117,104,334,204", nil, 10, 10, },
