	id_10124 = {10124, "阿布萨罗姆", "阿布萨拉姆", 1, "1", "透明之果能力者，月光·莫利亚部下。僵尸士兵与僵尸将军指挥官。肉体经过豪格巴克改造，拥有300公斤重量的野性力量，双手有装置火箭炮。", "fight_elite_abu.png", "head_elite_abu.png", "body_elite_abu.png", "body_elite_abu.png", nil, "14", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 3460, nil, 3470, "999|0,999|0,999|0", 800, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|204008", 4, nil, nil, 4, nil, 10124, 4, 1000, 5000, 10000, 500, 500, "85800", "2|1|200,2|3|4801,2|5|9302,2|6|403,2|7|3602,2|8|105", "330124,1240099,101,344,213", nil, 10, 10, },
	id_10125 = {10125, "迪巴鲁", "迪巴鲁", 1, "1", "飞鱼骑士团的大哥，坐骑是一只很大很呆很可爱的牛牛，和山智悬赏单中的相貌一样，除了眉毛卷曲的方向。他被山智的整容踢成了帅哥。", "fight_elite_dbl.png", "head_elite_dbl.png", "body_elite_dbl.png", "body_elite_dbl.png", nil, "14", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 3480, nil, 3490, "999|0,999|0,999|0", 900, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10125, 4, 1000, 5000, 10000, 500, 500, nil, "2|1|200,2|3|3301,2|5|9302,2|6|403,2|7|7802,2|8|105", "1150125,1320125,105,126,316", nil, 10, 10, },
