	id_10127 = {10127, "强巴鲁", "江波尔", 1, "1", "原海盗团船长，后被天龙人买下作为奴隶。被解放之后成为了罗的部下，加入了心脏海盗团，力量上与和平主义者不相上下。", "fight_elite_qbl.png", "head_elite_qbl.png", "body_elite_qbl.png", "body_elite_qbl.png", nil, "14", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 3520, nil, 3530, "999|0,999|0,999|0", 900, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10127, 4, 1000, 5000, 10000, 500, 500, nil, "2|1|200,2|3|1101,2|5|9302,2|6|403,2|7|4802,2|8|105", "660127,1300127,105,135,340", nil, 10, 10, },
	id_10128 = {10128, "萨鲁戴斯", "侯斯", 1, "1", "因佩尔监狱牢番长，“蓝猩猩”指挥官。手持三叉枪，同时也是操控“蓝猩猩”的笛子，特征是二头身的短小身材和帽子上的两只角。", "fight_elite_dlst.png", "head_elite_dlst.png", "body_elite_dlst.png", "body_elite_dlst.png", nil, "14", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 3540, nil, 3550, "999|0,999|0,999|0", 900, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10128, 4, 1000, 5000, 10000, 500, 500, nil, "2|1|200,2|3|1201,2|5|9302,2|6|403,2|7|3602,2|8|105", "1280105,1110128,114,323,166", nil, 10, 10, },
	id_10129 = {10129, "咋婆婆", "火焰花", 1, "2", "九蛇岛的前前前代皇帝，特征是比常人还要矮小的身高，白色的波浪发，左边发际插著一朵花，身边宠养的蛇卷曲成手杖，族人和她对话的时候都必须低头看着地面。", "fight_elite_zpp.png", "head_elite_zpp.png", "body_elite_zpp.png", "body_elite_zpp.png", nil, "14", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 3560, nil, 3570, "999|0,999|0,999|0", 800, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10129, 4, 1000, 5000, 10000, 500, 500, nil, "2|1|200,2|3|1201,2|5|9302,2|6|403,2|7|3402,2|8|105", "610129,1290116,92,175,345", nil, 10, 10, },
	id_10130 = {10130, "戴鲁斯通", "泰鲁斯通", 1, "1", "卡雷拉造船公司一号船坞的工头，旗帜、软木栓、船帆裁缝工人。力大无穷但头脑简单，左胸刺有“船大工”的刺青，武器是战舰炮。", "fight_elite_dailu.png", "head_elite_dailu.png", "body_elite_dailu.png", "body_elite_dailu.png", nil, "14", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 3580, nil, 3590, "999|0,999|0,999|0", 900, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10130, 4, 1000, 5000, 10000, 500, 500, nil, "2|1|200,2|3|3601,2|5|9302,2|6|403,2|7|5302,2|8|105", "1300119,1300127,104,317,206", nil, 10, 10, },
	id_10131 = {10131, "桔梗", "桔梗", 1, "2", "九蛇岛，亚马逊·百合任护国战士队长。竖着很高的黑色马尾，有着修长凤眼的冷艳女子，坚守女儿岛“不让任何男人进入”的百年规则。", "fight_elite_jg.png", "head_elite_jg.png", "body_elite_jg.png", "body_elite_jg.png", nil, "14", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 3600, nil, 3610, "999|0,999|0,999|0", 800, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10131, 1, 1000, 5000, 10000, 500, 500, nil, "2|1|200,2|3|7801,2|5|9302,2|6|403,2|7|1102,2|8|105", "1010131,1310112,109,329,214", nil, 10, 10, },
	id_10132 = {10132, "斯多比", "香豌豆", 1, "2", "九蛇岛护国战士，与雏菊一同到丛林狩猎时发现长满香菇的路飞，后将他送进村子治理。", "fight_elite_sdb.png", "head_elite_sdb.png", "body_elite_sdb.png", "body_elite_sdb.png", nil, "14", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 3620, nil, 3630, "999|0,999|0,999|0", 900, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10132, 1, 1000, 5000, 10000, 500, 500, nil, "2|1|200,2|3|1101,2|5|9302,2|6|403,2|7|7802,2|8|105", "1320125,1780132,109,127,304", nil, 10, 10, },
	id_10133 = {10133, "玛格丽特", "雏菊", 1, "2", "九蛇岛的女战士，特征是微翘的金发和绑在大腿后方的箭筒。性格单纯又直爽，善良又勇敢。对路飞保持着好感，并成为了路飞重要的朋友。", "fight_elite_mglt.png", "head_elite_mglt.png", "body_elite_mglt.png", "body_elite_mglt.png", nil, "14", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 3640, nil, 3650, "999|0,999|0,999|0", 900, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 4, nil, nil, 4, nil, 10133, 1, 1000, 5000, 10000, 500, 500, nil, "2|1|200,2|3|3601,2|5|9302,2|6|403,2|7|9402,2|8|105", "310133,1290133,109,136,346", nil, 10, 10, },
