	id_10147 = {10147, "库力凯", "蒙布朗", 1, "1", "猿山联合军船长，是被世人视为大骗子的诺兰德的子孙，坚信空岛和黄金乡的存在，赌上一生与命运作斗争的男人。", "fight_elite_mengbulang.png", "head_elite_mengbulang.png", "body_elite_mengbulang.png", "body_elite_mengbulang.png", nil, "13", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 3880, nil, 3890, "999|0,999|0,999|0", 600, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 3, nil, nil, 3, nil, 10147, 2, 1000, 5000, 10000, 500, 500, nil, nil, "1111,1112,1470001", nil, 10, 6, },
	id_10148 = {10148, "玛斯拉", "人猿", 1, "1", "人猿海盗团船长，外表长的像猴子，也会发出“呜吱吱”的声音，除了惊人的肺活量外，还有足以一拳打倒海王类的惊人怪力。", "fight_elite_masila.png", "head_elite_masila.png", "body_elite_masila.png", "body_elite_masila.png", nil, "13", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 3900, nil, 3910, "999|0,999|0,999|0", 500, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 3, nil, nil, 3, nil, 10148, 2, 1000, 5000, 10000, 500, 500, nil, nil, "1121,1122,1480001", nil, 10, 6, },
	id_10149 = {10149, "猩猩", "猩猩", 1, "1", "猩猩海盗团船长，外表就如他的名字一样，但却是个人类，被人瞧不起就会作出被吓一跳的样子，帮助草帽一伙改造梅利号。", "fight_elite_xingxing.png", "head_elite_xingxing.png", "body_elite_xingxing.png", "body_elite_xingxing.png", nil, "13", nil, nil, nil, nil, 10, 14, 12, nil, nil, nil, nil, nil, nil, nil, 3920, nil, 3930, "999|0,999|0,999|0", 600, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 3, nil, nil, 3, nil, 10149, 2, 1000, 5000, 10000, 500, 500, nil, nil, "1131,1132,1490001", nil, 10, 6, },
