	id_40031 = {40031, "剧情版佛之战国", "战国", 1, "1", "动物系人人之果能力者，原海军本部元帅，被称为“智将”，虽性格随和却有着压倒性的气势，实力深不可测。", "fight_elite_zhanguo.png", "head_elite_zhanguo.png", "body_elite_zhanguo.png", "body_elite_zhanguo.png", "nuqi_zhanguo.png", "41", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 1020, nil, 1030, "999|0,999|0,999|0", 1300, 4, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 7, nil, nil, 7, nil, 30162, 1, nil, 5000, 10000, nil, nil, "50200,84600", nil, nil, nil, 10, 16, },
