	id_40029 = {40029, "剧情版人妖王伊娃", "伊娃科夫", 1, "2", "荷尔蒙之果能力者。革命军的干部，曾为人妖王国的女王，医术高明。", "fight_elite_renyaowang.png", "head_elite_renyaowang.png", "body_elite_renyaowang.png", "body_elite_renyaowang.png", "nuqi_renyaowang.png", "41", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 1800, nil, 1810, "999|0,999|0,999|0", 1100, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 6, nil, nil, 6, nil, 30164, 3, nil, 5000, 10000, nil, nil, "54100,82600", nil, nil, nil, 10, 16, },
	id_40028 = {40028, "剧情版甚平", "甚平", 1, "1", "原“王下七武海”之一，太阳海盗团船长，人称“海侠”。鲸鲨鱼人，拥有可怕的怪力，擅长“鱼人空手道”，在海中可发挥最大力量。", "fight_elite_shenping.png", "head_elite_shenping.png", "body_elite_shenping.png", "body_elite_shenping.png", "nuqi_shenping.png", "41", nil, nil, nil, nil, 2, 8, 6, nil, nil, nil, nil, nil, nil, nil, 4880, nil, 4890, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 6, nil, nil, 6, nil, 30165, 3, nil, 5000, 10000, nil, nil, "52600", nil, nil, nil, 10, 16, },
