	id_40003 = {40003, "放逐版索隆", "佐罗", 1, "1", "草帽一伙第二战斗力，十一超新星之一，三刀流剑客。正义感强、有牺牲精神、爱睡觉，还是个超级路痴。目标是成为世界第一的大剑豪。", "fight_elite_suolong.png", "head_elite_suolong.png", "body_elite_suolong.png", "body_elite_suolong.png", "nuqi_suolong.png", "41", nil, nil, nil, nil, 3, 9, 7, nil, nil, 110000, nil, nil, nil, nil, 1620, nil, 1630, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 5, nil, nil, 5, nil, 40003, 4, nil, 5000, 10000, nil, nil, "53200", nil, nil, nil, 10, 13, },
	id_40004 = {40004, "隐身虚无版可雅", "嘉雅", 1, "2", "撒谎布村庄里大户人家的千金，一头金发，皮肤白皙，性格温柔善良。", "fight_elite_keya.png", "head_elite_keya.png", "body_elite_keya.png", "body_elite_keya.png", "nuqi_keya.png", "41", nil, nil, nil, nil, 2, 8, 6, nil, nil, 110100, nil, nil, nil, nil, 2440, nil, 2450, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 5, nil, nil, 5, nil, 40004, 3, nil, 5000, 10000, nil, nil, nil, nil, nil, nil, 10, 13, },
