	id_40006 = {40006, "剧情版赤犬", "萨卡斯基", 1, "1", "自然系岩浆之果能力者。原为海军三大将之一，顶上战争后成为海军元帅。为了维护世界政府的统治可以把任何人当牺牲品。", "fight_elite_chiquan.png", "head_elite_chiquan.png", "body_elite_chiquan.png", "body_elite_chiquan.png", "nuqi_chiquan.png", "41", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 4400, nil, 4410, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 7, nil, nil, 7, nil, 40006, 4, nil, 5000, 10000, nil, nil, "50900,80500", "2|1|101,2|3|3601,2|5|3601,2|7|21200,2|9|5904,2|11|20800", nil, nil, 10, 18, },
	id_40007 = {40007, "无敌版路飞", "路飞", 1, "1", "草帽一伙船长。因为四皇“红发”杰克斯委托保管的草帽，被称为“草帽小子路飞”。橡胶果实的能力者，梦想是完成对杰克斯的承诺，找到传说中的ONE PIECE，成为海盗王。", "fight_elite_lufei.png", "head_elite_lufei.png", "body_elite_lufei.png", "body_elite_lufei.png", "nuqi_lufei.png", "41", nil, nil, nil, nil, 3, 9, 7, nil, nil, 110200, nil, nil, nil, nil, 1600, nil, 1610, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 5, nil, nil, 5, nil, 40007, 4, nil, 5000, 10000, nil, nil, "81900", nil, nil, nil, 10, 13, },
