	id_40009 = {40009, "无敌版乌索普", "撒谎布", 1, "1", "草帽一伙狙击手，擅长改造工具，远距离狙击敌人，是一名智慧型的战斗员，在草帽一伙中负责吐槽，梦想是要成为勇敢的海上战士。", "fight_elite_wusuopu.png", "head_elite_wusuopu.png", "body_elite_wusuopu.png", "body_elite_wusuopu.png", "nuqi_wusuopu.png", "41", nil, nil, nil, nil, 2, 8, 6, nil, nil, 110200, nil, nil, nil, nil, 1260, nil, 1270, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 5, nil, nil, 5, nil, 40009, 1, nil, 5000, 10000, nil, nil, "51400", nil, nil, nil, 10, 13, },
