	id_50031 = {50031, "橙色路飞", "路飞", 1, "1", "草帽一伙船长。因为四皇“红发”杰克斯委托保管的草帽，被称为“草帽小子路飞”。橡胶果实的能力者，梦想是完成对杰克斯的承诺，找到传说中的ONE PIECE，成为海盗王。", "fight_elite_lufei.png", "head_elite_lufei.png", "body_elite_lufei.png", "body_elite_lufei.png", "nuqi_lufei.png", "16", nil, nil, nil, nil, 2, 8, 6, nil, nil, nil, nil, nil, nil, nil, 140180, nil, 140190, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|205019", 6, nil, nil, 6, nil, 10031, 4, 1000, 5000, 10000, 500, 500, "66000,81900", "2|1|31000,2|3|1401,2|5|9302,2|6|103,2|7|1203,2|8|405,2|9|3505,2|10|107,2|11|2007", "310018,310025,410031,36,275,230,375", nil, 10, 16, },
	id_50032 = {50032, "橙色索隆", "佐罗", 1, "1", "草帽一伙第二战斗力，十一超新星之一，三刀流剑客。正义感强、有牺牲精神、爱睡觉，还是个超级路痴。目标是成为世界第一的大剑豪。", "fight_elite_suolong.png", "head_elite_suolong.png", "body_elite_suolong.png", "body_elite_suolong.png", "nuqi_suolong.png", "16", nil, nil, nil, nil, 2, 8, 6, nil, nil, nil, nil, nil, nil, nil, 140200, nil, 140210, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 6, nil, nil, 6, nil, 10032, 2, 1000, 5000, 10000, 500, 500, "66100", "2|1|901,2|3|5401,2|5|9302,2|6|103,2|7|21200,2|8|405,2|9|3505,2|10|107,2|11|6007", "320024,380032,600032,37,143,266,376", nil, 10, 16, },
	id_50033 = {50033, "橙色山治", "山智", 1, "1", "草帽一伙厨师，有着卷曲眉毛，永远遮住半边脸的家伙，很花心但很有风度，海盗中的绅士。梦想是找到传说之海All Blue。", "fight_elite_xiangjishi.png", "head_elite_xiangjishi.png", "body_elite_xiangjishi.png", "body_elite_xiangjishi.png", "nuqi_xiangjishi.png", "16", nil, nil, nil, nil, 2, 8, 6, nil, nil, nil, nil, nil, nil, nil, 140220, nil, 140230, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 6, nil, nil, 6, nil, 10033, 4, 1000, 5000, 10000, 500, 500, "66200", "2|1|401,2|3|1201,2|5|9302,2|6|103,2|7|1203,2|8|405,2|9|30600,2|10|107,2|11|6107", "330015,640033,760033,38,154,280,377", nil, 10, 16, },
	id_50036 = {50036, "橙色马尔科", "马尔高", 1, "1", "动物系恶魔果实能力者，称号是“不死鸟”，白胡子海盗团第一队队长。 主要用脚进行踢击，受伤时伤口会被青色火焰包围然后重生，使攻击无效化。", "fight_elite_maerke.png", "head_elite_maerke.png", "body_elite_maerke.png", "body_elite_maerke.png", "nuqi_maerke.png", "16", nil, nil, nil, nil, 10, 14, 12, nil, nil, nil, nil, nil, nil, nil, 140240, nil, 140250, "999|0,999|0,999|0", 1300, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|205022", 6, nil, nil, 6, nil, 10036, 4, 1000, 5000, 10000, 500, 500, "66300,82200", "2|1|1001,2|3|9501,2|5|9302,2|6|103,2|7|3403,2|8|405,2|9|30700,2|10|107,2|11|6107", "20036,50036,350036,18,357", nil, 10, 16, },
