	id_50048 = {50048, "橙色蒂波", "卡特琳·蝶美", 1, "2", "关押在因佩尔监狱最下层的史上最凶恶女囚。特征是浓妆艳抹、奇装异服和高耸的鼻子，是个如同魔女一般的海盗。被黑胡子一行救出，加入黑胡子一行。", "fight_elite_diemei.png", "head_elite_diemei.png", "body_elite_diemei.png", "body_elite_diemei.png", nil, "16", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 140460, nil, 140470, "999|0,999|0,999|0", 1000, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 6, nil, nil, 6, nil, 10048, 1, 1000, 5000, 10000, 500, 500, "67400", "2|1|1001,2|3|1201,2|5|9302,2|6|103,2|7|9003,2|8|405,2|9|3305,2|10|107,2|11|4607", "570048,720048,810048,91", nil, 10, 16, },
	id_50053 = {50053, "橙色钻石乔兹", "乔兹", 1, "1", "能够全身化为钻石，白胡子海盗团第三番队队长。身材魁梧的巨汉，拥有强大的腕力能把比巨人族还要巨大的冰块或巨石丢出去的力量。", "fight_elite_qiaozi.png", "head_elite_qiaozi.png", "body_elite_qiaozi.png", "body_elite_qiaozi.png", nil, "16", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 140480, nil, 140490, "999|0,999|0,999|0", 1100, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|205030", 6, nil, nil, 6, nil, 10053, 1, 1000, 5000, 10000, 500, 500, "67800", "2|1|201,2|3|3601,2|5|9302,2|6|103,2|7|4903,2|8|405,2|9|3405,2|10|107,2|11|6107", "400053,530046,670053,19,358", nil, 10, 16, },
