	id_50085 = {50085, "橙色小丑巴基", "巴奇", 1, "1", "四分五裂之果能力者，巴奇海盗团船长，顶上之战后，巴奇应邀成为世界政府直辖王下七武海之一。有着一个大红鼻子，外形像小丑，最讨厌别人谈论他的鼻子。", "fight_elite_baji.png", "head_elite_baji.png", "body_elite_baji.png", "body_elite_baji.png", "nuqi_baji.png", "16", nil, nil, nil, nil, 3, 9, 7, nil, nil, nil, nil, nil, nil, nil, 141100, nil, 141110, "999|0,999|0,999|0", 1100, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|205040", 6, nil, nil, 6, nil, 10085, 4, 1000, 5000, 10000, 500, 500, "70900,84000", "2|1|301,2|3|5701,2|5|9302,2|6|403,2|7|3403,2|8|405,2|9|4705,2|10|107,2|11|2507", "850077,860085,1150085,47,198,299,386", nil, 10, 16, },
