	id_50104 = {50104, "橙色Mr.3", "加尔迪诺", 1, "1", "蜡蜡果实能力者，可以用蜡做成任何东西。原为巴洛克集团的高级干部之一，在鳄鱼被打倒后被关入因佩尔监狱，之后协助路飞前往海军本部营救艾斯。", "fight_elite_mr3.png", "head_elite_mr3.png", "body_elite_mr3.png", "body_elite_mr3.png", "nuqi_mr.3.png", "16", nil, nil, nil, nil, 11, 15, 13, nil, nil, nil, nil, nil, nil, nil, 141200, nil, 141210, "999|0,999|0,999|0", 1100, 2, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, "0|205048", 6, nil, nil, 6, nil, 10104, 4, 1000, 5000, 10000, 500, 500, "71400,84800", "2|1|300,2|3|5601,2|5|9302,2|6|103,2|7|1103,2|8|405,2|9|6105,2|10|107,2|11|6106", "220104,1040061,850104,63,188,297", nil, 10, 15, },
